import React from 'react'
import Hotel from "../Images/resorts.png";
const IndexHotel = () => {
  return (

   <div className='bg-gradient-to-t from-green-100 to-blue-100'>
    <img src={Hotel} className="h-64 w-64 mx-auto" />
    <div className='w-full min-h-screen text-center text-xl justify-center items-center flex'>
      
      Hotel Services Will be available soon
    </div>
   </div>
  )
}

export default IndexHotel
